import React from "react";
import TablaProveedor from "./componentes/TablaProveedor";
import { Plus } from "lucide-react";

function Proveedores() {
  return (
    <div className="w-full pt-6">
      <div className="flex-row space-y-0.5 pl-6">
        <span className="text-xl font-semibold">Proveedores</span>
        <p className="text-xs text-slate-600">Listado de proveedores</p>
        <div className="flex space-x-5 pt-4">
          <p className="border-b-2-blue-400 pb-2">Proveedores activos</p>
          <p>Proveedores inactivos</p>
        </div>
      </div>
      <TablaProveedor />
      <a href="/productos/agregar ">
        <div className="bg-blue-600 w-fit p-2 rounded-full">
          <Plus className="w-7 h-7 text-slate-100" />
        </div>
      </a>
    </div>
  );
}

export default Proveedores;
